			<Grid container direction='column' justify='center' alignItems='stretch'>
				<Grid item xs={12}>
					<div>Search Bar Component</div>
				</Grid>
				<Grid item xs={12}>
					<Grid>
                        
                    </Grid>
				</Grid>
			</Grid>
		</Auxiliary>
	);
};

export default layout;
